import{_ as i,o as e,c as t,O as a}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 13.1-1074 Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/13.1-1074.md","filePath":"vacode/13.1-1074.md"}'),o={name:"vacode/13.1-1074.md"},n=a('<h1 id="§-13-1-1074-definitions" tabindex="-1">§ 13.1-1074 Definitions. <a class="header-anchor" href="#§-13-1-1074-definitions" aria-label="Permalink to &quot;§ 13.1-1074 Definitions.&quot;">​</a></h1><p>As used in this article, unless the context requires a different meaning:</p><p>&quot;Domesticated limited liability company&quot; means the domesticating limited liability company as it continues in existence after a domestication.</p><p>&quot;Domesticating limited liability company&quot; means the domestic limited liability company that approves a plan of domestication pursuant to § <a href="/vacode/13.1-1075/">13.1-1075</a> or the foreign limited liability company that approves a domestication pursuant to the organic law of the foreign limited liability company.</p><p>&quot;Domestication&quot; means a transaction pursuant to this article, including domestication of a foreign limited liability company as a domestic limited liability company or domestication of a domestic limited liability company in another jurisdiction, where the other jurisdiction authorizes such a transaction even if by another name.</p><p>2006, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0912" target="_blank" rel="noreferrer">912</a>; 2013, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?131+ful+CHAP0017" target="_blank" rel="noreferrer">17</a>; 2021, Sp. Sess. I, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0487" target="_blank" rel="noreferrer">487</a>.</p>',6),r=[n];function s(c,l,d,m,p,f){return e(),t("div",null,r)}const u=i(o,[["render",s]]);export{_ as __pageData,u as default};
